import React from "react";

import Fragmento from "./components/basicos/Fragmento";
import ComParametro from "./components/basicos/ComParametro";
import Primeiro from "./components/basicos/Primeiro";
import DesafioNumeroAleatorio from "./components/basicos/DesafioNumeroAleatorio";
import Card from "./components/layout/Card";

export default (props) => {
  return (
    <div id="app">
      <h1>Fundamentos react</h1>
      <Card title="#04 - Desafio número aleatório">
        <DesafioNumeroAleatorio
          min={1}
          max={5}
        />
      </Card>

      <Card title="#03 - Fragmento">
        <Fragmento />
      </Card>

      <Card title="#02 - Com Parametro">
      <ComParametro
        titulo="Situação do aluno(a)"
        subtitulo="Muito legal! (prop subtitulo)"
        aluno="Chrystian"
        nota={9.3}
      />
      </Card>

      <Card title="#01 - Primeiro">
        <Primeiro />
      </Card>
     
      
      
    </div>
  )
}
